import React from 'react';
import './index.css';
import cityImage from './images/city.jpg'; // Adjust the path to your image file

const App = () => {
  return (
    <div className="container">
      <div className="right-section">
        <img src={cityImage} alt="City Background" className="right-image" />
      </div>
    </div>
  );
};

export default App;
